import styled from 'styled-components'
import { ArrowLeftOutlinedIcon, ArrowRightOutlinedIcon } from '@material-ui/icons/ArrowLeftOutlined';

const Container = styled.div`

        height:100vh;
        width:100%;
        display:flex;

`

const Slider = () => {
    return (
        <Container>
            <Arrow>
                <ArrowLeftOutlinedIcon />
            </Arrow>
            <Arrow>
                <ArrowRightOutlinedIcon/>
            </Arrow>
        </Container>
    )
}

export default Slider;
